import React from 'react';

const BoardList = ({form, children}) => {
  return (
    <main className="list-wrap">
      <div className="title">
        오늘 할 일
      </div>
      <section className="form-wrapper">
        {form}
      </section>
      <section className="todos-wrapper">
        { children }
      </section>
    </main>
  );
}

export default BoardList;
